    num? status,
    bool? isSuccess,
    dynamic message,
    TripSearchResultModel? data,
  }) {
    _status = status;
    _isSuccess = isSuccess;
    _message = message;
    _data = data;
  }

  TripsSearchResponse.fromJson(dynamic json) {
    _status = json['status'];
    _isSuccess = json['isSuccess'];
    _message = json['message'];
    _data = json['data'] != null
        ? TripSearchResultModel.fromJson(json['data'])
        : null;
  }

  num? _status;
  bool? _isSuccess;
  dynamic _message;
  TripSearchResultModel? _data;

  TripsSearchResponse copyWith({
    num? status,
    bool? isSuccess,
    dynamic message,
    TripSearchResultModel? data,
  }) =>
      TripsSearchResponse(
        status: status ?? _status,
        isSuccess: isSuccess ?? _isSuccess,
        message: message ?? _message,
        data: data ?? _data,
      );

  num? get status => _status;

  bool? get isSuccess => _isSuccess;

  dynamic get message => _message;

  TripSearchResultModel? get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['isSuccess'] = _isSuccess;
    map['message'] = _message;
    if (_data != null) {
      map['data'] = _data?.toJson();
    }
    return map;
  }
}

