class TripSearchResultModel {
  TripSearchResultModel({
    List<OrgTripModel>? orgTrips,
    List<PublicTripModel>? publicTrips,
  }) {
    _orgTrips = orgTrips;
    _publicTrips = publicTrips;
  }

  TripSearchResultModel.fromJson(dynamic json) {
    if (json['orgTrips'] != null) {
      _orgTrips = [];
      json['orgTrips'].forEach((v) {
        _orgTrips?.add(OrgTripModel.fromJson(v));
      });
    }
    if (json['publicTrips'] != null) {
      _publicTrips = [];
      json['publicTrips'].forEach((v) {
        _publicTrips?.add(PublicTripModel.fromJson(v));
      });
    }
  }

  List<OrgTripModel>? _orgTrips;
  List<PublicTripModel>? _publicTrips;

  TripSearchResultModel copyWith({
    List<OrgTripModel>? orgTrips,
    List<PublicTripModel>? publicTrips,
  }) =>
      TripSearchResultModel(
        orgTrips: orgTrips ?? _orgTrips,
        publicTrips: publicTrips ?? _publicTrips,
      );

  List<OrgTripModel>? get orgTrips => _orgTrips;

  List<PublicTripModel>? get publicTrips => _publicTrips;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_orgTrips != null) {
      map['orgTrips'] = _orgTrips?.map((v) => v.toJson()).toList();
    }
    if (_publicTrips != null) {
      map['publicTrips'] = _publicTrips?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

